window.bookSummaryJSON = "<p>The final volume of the Uplift trilogy by Hugo and Nebula Award winner David Brin, <i>Heaven’s Reach</i> brings readers back to the planet Jijo one last time. The starship Streaker is still on the run with its dangerous cargo of ancient artifacts when the prophesied Time of Changes rocks the galaxy. As each race battles for control and chaos reigns, the truth about the Five Galaxies and The Progenitors finally comes to light.</p>"; 
